import React from "react";
import "./SectionSix.css";
import Slider from "react-slick";
import ArrowForwardIcon from "@mui/icons-material/ArrowForward";
import ArrowBackIcon from "@mui/icons-material/ArrowBack";

function SampleNextArrow(props) {
  const { className, style, onClick } = props;
  return (
    <div
      style={{
        ...style,
        top: "40%",
        right: "10px",
        zIndex: "2",
        backgroundColor: "#fff",
        height: "32px",
        border: "2px solid #e1e1e1",
        cursor: "pointer",
        padding: "2px",
        borderRadius: "50%",
        position: "absolute",
      }}
      onClick={onClick}
    >
      <ArrowForwardIcon style={{ fontSize: "2rem" }} />
    </div>
  );
}

function SamplePrevArrow(props) {
  const { className, style, onClick } = props;
  return (
    <div
      style={{
        ...style,
        top: "40%",
        left: "12px",
        zIndex: "2",
        backgroundColor: "#fff",
        cursor: "pointer",
        height: "32px",
        border: "2px solid #e1e1e1",
        padding: "2px",
        borderRadius: "50%",
        position: "absolute",
      }}
      onClick={onClick}
    >
      <ArrowBackIcon style={{ fontSize: "2rem" }} />
    </div>
  );
}

const data = [
  {
    id: 1,
    img: "/Sec6product1.avif",
    head: "Post-Poo Drops",
    para: "A botanical bathroom deodoriser",
  },
  {
    id: 2,
    img: "/product2.avif",
    head: "  Aganice Aromatique Candle",
    para: "Cardamom, Mimosa, Tobacco",
  },

  {
    id: 3,
    img: "./product3.avif",
    head: "Ptolemy Aromatique Candle",
    para: "A sensuous blend of leather, smoke and wood",
  },
  {
    id: 4,
    img: "./product4.avif",
    head: "Callippus Aromatique Candle",
    para: "A marriage of deep greens and earthy spices",
  },
  {
    id: 5,
    img: "./product5.avif",
    head: "Bronze Incense Holder ",
    para: "Suited to any interior",
  },
  {
    id: 6,
    img: "./product4.avif",
    head: "Murasaki Aromatique Incense",
    para: "For those who favour aromas of warm spice",
  },
  {
    id: 7,
    img: "./product4.avif",
    head: "Kagerou Aromatique Incense",
    para: "For those particularly partial to Vetiver",
  },
  {
    id: 7,
    img: "./product4.avif",
    head: "Sarashina Aromatique Incense",
    para: "For those particularly partial to Sandalwood",
  },
];

var settings = {
  dots: true,
  infinite: true,
  speed: 500,
  slidesToShow: 3,
  slidesToScroll: 1,
  nextArrow: <SampleNextArrow />,
  prevArrow: <SamplePrevArrow />,
  initialSlide: 0,
  responsive: [
    {
      breakpoint: 1024,
      settings: {
        slidesToShow: 3,
        slidesToScroll: 3,
        infinite: true,
        dots: true,
      },
    },
    {
      breakpoint: 600,
      settings: {
        slidesToShow: 2,
        slidesToScroll: 2,
        initialSlide: 2,
      },
    },
    {
      breakpoint: 480,
      settings: {
        slidesToShow: 1,
        slidesToScroll: 1,
      },
    },
  ],
};

function SectionSix() {
  return (
    <div>
      <div className="SectionSix">
        <Slider {...settings}>
          <div className="sec1">
            <div className="col2">
              <h4>For the home</h4>
              <h1>Domestic pleasures</h1>
              <p>
                Our range of aromatic formulations for the home are practical
                and pleasing in equal measure.
              </p>
              <a href="" className="btn">
                <p>See all Home </p>
                <ArrowForwardIcon />
              </a>
            </div>
          </div>
          {data.map((x) => {
            return (
              <div>
                <div key={x.id} className="product">
                  <img src={x.img} />
                  <h4>{x.head}</h4>
                  <p>{x.para}</p>
                </div>
              </div>
            );
          })}
        </Slider>
      </div>
    </div>
  );
}

export default SectionSix;
